import React from 'react';

export default class SocialCard extends React.Component{
    render(){
        const {author, post} = this.props.info;
        console.log(author, post);
        return (
            <article className='card text-center border-dark mb-3 container' style={{maxWidth: "18rem"}}>
                <div className='card-header bg-transparent border-dark row'>
                    <img className='card-img col-3' src={author.imgUrl} alt='Hey' />
                    <h3 className='card-text text-left col-9'>{author.name}</h3>
                </div>
                <div className='card-body text-dark'>
                    <img className='card-img' src={post.imgUrl} alt="Hey!" />
                    <h5 className='card-title'>Title</h5>
                    <p className='card-text'>Text</p>
                </div>
                <div className="card-footer bg-transparent border-dark">Footer</div>
            </article>
        )
    }
}
